    [],nt"revision_timestamp": "2016-07-27T22:57:23.630158",nt"name": "squaw-creek-national-wildlife-refuge-annual-narrative-report-fiscal-year-1997",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Squaw
    Creek NWR outlines activities and accomplishments during the 1997 fiscal year. The
    report begins with an introduction to the Refuge. Highlights and weather conditions
    are summarized for the year. Information about monitoring and studies- including
    surveys and censuses and studies and investigations- is provided next. Habitat restoration
    and management projects are also covered; activities include wetland restoration,
    upland restoration, water level management, moist soil management, grazing/mowing/haying,
    farming, fire management, and vegetation control. Fish and wildlife management are
    discussed next with emphasis on nest structures. Coordination activities, such as
    interagency coordination, private land activities, and cooperative organizations,
    are outlined. The resource protection section provides an update on law enforcement,
    contaminants, cultural resource management, and land acquisition support. Information
    about public education and recreation is given including visitor services and outreach.
    Finally, comprehensive management planning and general administration are discussed
    in the Refuge planning and administration section. Field guides are attached.",nt"license_title":
